export default class User {

	constructor(aid, aname, aage){
        this.id = aid
        this.name = aname
        this.age = aage	
    }

    static fromJSON(account) {
		let results = null;
		if (Array.isArray(account)) {
			results = [];
			account.forEach((x) => {
				Object.setPrototypeOf(x, User.prototype);
				results.push(x);
			})
		} else {
			let x = account;
			Object.setPrototypeOf(x, User.prototype);
			results = x;
		}
		return results;
	}
}
